import React from 'react'
import { ResetPassword } from './ResetPasswordConfirm'
import {connect} from 'react-redux'
import { Redirect } from 'react-router-dom'




class ResetPasswordConfirmContainer extends React.Component {
    render () {
        return (<div><ResetPassword code={this.props.code} /></div>)
    }
}

const mapStateToProps = (state) => ({
    code: state.auth.code
})

export default connect(mapStateToProps)(ResetPasswordConfirmContainer)
